		hospitalCross.addEventListener('click', function () {

		buttonBuildFacility.addEventListener('click', buildClick);
		function buildClick() {
			if (buttonBuildFacility.clickable) {
				btnSFX.play();

				build.button.gotoAndPlay(15);
				buttonBuildFacility.play();
				buttonBuildFacility.hand.visible = false;
				buttonBuildFacility.clickable = false;
				hangarCross.clickable = false;
				hospitalCross.clickable = false;
				upgradeSFX.play();

					if (buildCount <= 0) {
						main.build.gotoAndPlay(1);
						buildCount++;
					} else {
						main.build.gotoAndPlay(77);
						buildCount++;
					}
				} else if (hospitalSilueth.visible) {
					if (buildCount <= 0) {
						main.build.gotoAndPlay(55);

						buildCount++;
					}
				}

			if (buildCount == 1) {
				hangarCross.clickable = true;
				hospitalCross.clickable = true;
			}
			if (buildCount >= 2) {
				//return to main menu
				tasksCount++;
				checkTasks();
				ui.gotoAndPlay(15);
				staff_btn.gotoAndStop(1);
				training_btn.gotoAndStop(1);

				training_btn.clickable = true;

				if((respDim=='width'&&lastW==iw) || (respDim=='height'&&lastH==ih)) {                    
					sRatio = lastS;                
				}				
				else if(!isScale) {					
					if(iw<w || ih<h)						
						sRatio = Math.min(xRatio, yRatio);				
				}				
				else if(scaleType==1) {					
					sRatio = Math.min(xRatio, yRatio);				
				}				
				else if(scaleType==2) {					
					sRatio = Math.max(xRatio, yRatio);				
				}			
			}			
			canvas.width = w*pRatio*sRatio;			
			canvas.height = h*pRatio*sRatio;
			canvas.style.width = dom_overlay_container.style.width = anim_container.style.width =  w*sRatio+'px';				
			canvas.style.height = anim_container.style.height = dom_overlay_container.style.height = h*sRatio+'px';
			stage.scaleX = pRatio*sRatio;			
			stage.scaleY = pRatio*sRatio;			
			lastW = iw; lastH = ih; lastS = sRatio;            
			stage.tickOnUpdate = false;            
			stage.update();            
			stage.tickOnUpdate = true;		
		}
	}
	makeResponsive(false,'both',false,1);	
	AdobeAn.compositionLoaded(lib.properties.id);
	fnStartAnimation();
}
</script>
